- input: "TEXT\x1CC00305797\x1C.TEXT\x1C\x1CF3XA\x1CAmerica's Foundation received
    payments for list rental services, and these payments did not exceed the usual
    and normal charge for these services.  We assessed the usual and normal charge
    for these services by comparing the amounts received to previous amounts America's
    Foundation has either researched, or been charged to purchase or rent lists from
    list brokerage firms the PAC has used.   All of the expenditures listed on Schedule
    B, Line 21(b) were PAC expenses and none of these expenditures were for public
    communications or voter drive activity that contained express advocacy of a clearly
    identified federal candidate.        We are filing this Amended Report in response
    to the Request For Additional Information dated April 14, 2010.    Please note
    that we have provided additional information in this amended report for many of
    the donors that were originally missing information.  In addition, our best efforts
    procedures for obtaining the required information are as follows: (1) our solicitations
    for contributions contain a clear and conspicuous request for the required information
    and the solicitations inform the contributor that this information is required
    to be reported under federal law, (2) a follow up letter is sent within 30 days
    of receipt if the required information was not provided, and (3) the committee
    will either file amended reports, or will report memo entries on the next report
    if it receives the information after the filing of the previous report.                 \n"
